function Queue(){this.queue=[];this.getLength=function(){return(this.queue.length)};this.isEmpty=function(){return(this.queue.length==0)};this.enqueue=function(item){this.queue.push(item)};this.dequeue=function(){if(this.queue.length==0)return undefined;var item=this.queue[0];var new_arr=[];for(var i=1;i<this.queue.length;i++){new_arr.push(this.queue[i])}this.queue=new_arr;return item};this.peek=function(){return(this.queue.length>0?this.queue[0]:undefined)};this.getAll=function(){return this.queue}}